import React from 'react';
import {
  Container,
  Grid,
  GridList,
  GridListTile,
  IconButton,
  Typography
} from '@material-ui/core';
import {
  Apps as AppsIcon,
  Settings as SettingsIcon
} from '@material-ui/icons';

import { deviceThreatData } from '../data';

export default function AppControlContainer(){
  return(
    <Container>
      <Grid container>
        <AppsIcon />
        <Typography>App Protection</Typography>
      </Grid>
      <Grid container>
        <Typography>Apps Blocked: 3</Typography>
        <IconButton>
          <SettingsIcon />
        </IconButton>
      </Grid>
      <GridList cols={3}>
        {deviceThreatData.map((device) => {
          return(
            <GridListTile key={device.familyMember}>{device.familyMember}</GridListTile>
          )
        })}
      </GridList>
    </Container>
  )
};
